'Superunknown' is the fourth studio album by the American alternative rock band Soundgarden, released on March 8,
1994 through A&amp;M Records. Soundgarden began work on the album after touring in support of its previous album,
Badmotorfinger (1991). Superunknown captured the heaviness of the band's earlier releases while displaying a more diverse range of influences.Superunknown was a critical and commercial success and became the band's breakthrough album. It debuted at number one on the Billboard 200 and reached high positions on charts worldwide. Five singles were released from the album: &quot;The Day I Tried to Live&quot;, &quot;My Wave&quot;, &quot;Fell on Black Days&quot;, and the Grammy Award-winning songs &quot;Spoonman&quot; and &quot;Black Hole Sun&quot;, the latter two of which helped Soundgarden reach mainstream popularity. In 1995, the album was nominated for the Grammy Award for Best Rock Album. The album has been certified five times platinum by the RIAA in the United States and remains Soundgarden's most successful album.All lyrics written by Chris Cornell, except where noted.This is a great album without doubt But the next one was the bomb Blow up the Outside World anyway we will deal with whats in front of us.

